    "lpc-pronouns-strings.PronounsStrings.header.info": "Kaikki, joilla on tili työpaikallasi tai oppilaitoksessasi, mukaan lukien vierastili,t voivat nähdä pronominisi.",
    "lpc-pronouns-strings.PronounsStrings.input.enter": "Kirjoita pronominit tai valitse esimerkeistä",
