    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageFirstParagraphText": "Pronominit ovat sanoja, joita käytämme korvaamaan henkilön nimen virkkeessä, kuten suomen kielen \"hän\" tai englannin \"he\", \"she\" tai \"they\". Pronominit-kenttä on valinnainen paikka, jossa voit näyttää pronominisi muille profiilin kautta.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageSecondParagraphText": "Henkilön pronominien käyttäminen oikein on yksinkertainen tapa osoittaa, että arvostamme inklusiivisuutta ja kunnioitusta. Pronominien jakaminen itsensä esittelyn yhteydessä tai omassa profiilissa edistää inklusiivisen ympäristön luomista ja rohkaisee muitakin jakamaan omansa.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageTitle": "Profiilisi pronominit",
    "lpc-pronouns-strings.PronounsStrings.learnMore.learnMoreAltText": "Lisätietoja-kuva",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageFirstParagraphText": "On tärkeää olla olettamatta toisen käyttäjän sukupuoli-identiteettiä tai pronomineja ensivaikutelman perusteella. Kun meihin viitataan väärällä pronominilla, se voi tuntua epäkunnioittavalta. Panostamalla pronominien oikeaan käyttöön osoitamme arvostavamme inklusiivisuutta ja huomaavaisuutta. Opettele toisen henkilön pronominit tai harjoittele käyttämään pronomineja, jotka eivät ole sinulle tuttuja.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageSecondParagraphText": "Muista, että pronominit ovat osa henkilön identiteettiä ja itseilmaisua. Jokainen päättää itse, jakaako tai näyttääkö pronomininsa.",
